    "2016-09-24T15:28:43.160428",nt"name": "epa-office-of-water-ow-2002-impaired-waters-baseline-nhdplus-indexed-dataset",nt"isopen":
    false,nt"url": null,nt"notes": "This dataset consists of geospatial and
    attribute data identifying the spatial extent of state-reported impaired waters
    (EPA's Integrated Reporting categories 4a, 4b, 4c and 5)* available in EPA's Reach
    Address Database (RAD) at the time of extraction. For the 2002 baseline reporting
    year, EPA compiled state-submitted GIS data to create a seamless and nationally
    consistent picture of the Nation's impaired waters for measuring progress. EPA's
    Assessment and TMDL Tracking and Implementation System (ATTAINS) is a national compilation
    of states' 303(d) listings and TMDL development information, spanning several years
    of tracking over 40,000 impaired waters.",nt"license_title": null,nt"extras":
